import '../styles.css';
import MovieCard from './MovieCard';


export function MovieGrid(){
    const[movies,setMovies] =useState([]);
    useEffect(() => {
        fetch('movies.json')
          .then(response => response.json())
          .then(data => setMovies(data));
      }, []);
    return(
        <div className='movies-grid'>
            {
                movies.map(movie => (
                <MovieCard></MovieCard>
                    ))



